import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import RevendaPage from './RevendaPage'; // será usado em /revenda
import HomePage from './HomePage'; // página inicial
import ConfirmPage from './ConfirmPage';
import Pagamento from './pagamento';
import { HashRouter as Router, Routes, Route } from 'react-router-dom';

function Cancelado() {
  return (
    <main className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center text-center">
      <h1 className="text-3xl font-bold mb-2">Operação cancelada</h1>
      <p className="text-gray-400">Você recusou a transação.</p>
    </main>
  );
}

function Aguardando() {
  return (
    <main className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center text-center">
      <h1 className="text-3xl font-bold mb-2">Aguardando pagamento do outro usuário</h1>
      <p className="text-gray-400">Você será notificado quando o pagamento for concluído.</p>
    </main>
  );
}

ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />         {/* página inicial */}
        <Route path="/revenda" element={<RevendaPage />} />       {/* fluxo de revenda */}
        <Route path="/confirmar" element={<ConfirmPage />} />
        <Route path="/pagamento" element={<Pagamento />} />
        <Route path="/cancelado" element={<Cancelado />} />
        <Route path="/aguardando" element={<Aguardando />} />
      </Routes>
    </Router>
  </React.StrictMode>
);
